*/
// reactstrap components
import Chart from "chart.js";
// react plugin used to create charts
import { React, useRef, useState } from "react";
import { Link } from "react-router-dom";

import {
  Badge,
  Card,
  CardHeader,
  Col,
  DropdownMenu,
  DropdownItem,
  UncontrolledDropdown,
  DropdownToggle,
  NavItem,
  NavLink,
  Nav,
  Progress,
  Container,
  Row,
  CardBody,
  Button,
} from "reactstrap";

import { chartOptions, parseOptions } from "variables/charts.js";
// core components
import Header from "components/Headers/Header.js";

const SSh = () => {
  const [value, setValue] = useState("CSD 0");
  const [buttonColor1, setButtonColor1] = useState("success");
  const [buttonColor2, setButtonColor2] = useState("success");
  const [buttonColor3, setButtonColor3] = useState("success");
  const [buttonColor4, setButtonColor4] = useState("success");
  const [buttonColor5, setButtonColor5] = useState("success");
  const [buttonColor6, setButtonColor6] = useState("success");
  const [buttonColor7, setButtonColor7] = useState("success");
  const [buttonColor8, setButtonColor8] = useState("success");

  const set = (e) => {
    e.preventDefault();
    setValue(e.target.value);

    if (e.target.value === "CSD 1") {
      if (buttonColor1 === "success") {
        setButtonColor1("danger");
      } else {
        setButtonColor1("success");
      }
    } else if (e.target.value === "CSD 2") {
      if (buttonColor2 === "success") {
        setButtonColor2("danger");
      } else {
        setButtonColor2("success");
      }
    } else if (e.target.value === "CSD 3") {
      if (buttonColor3 === "success") {
        setButtonColor3("danger");
      } else {
        setButtonColor3("success");
      }
    } else if (e.target.value === "CSD 4") {
      if (buttonColor4 === "success") {
        setButtonColor4("danger");
      } else {
        setButtonColor4("success");
      }
    } else if (e.target.value === "CSD 5") {
      if (buttonColor5 === "success") {
        setButtonColor5("danger");
      } else {
        setButtonColor5("success");
      }
    } else if (e.target.value === "CSD 6") {
      if (buttonColor6 === "success") {
        setButtonColor6("danger");
      } else {
        setButtonColor6("success");
      }
    } else if (e.target.value === "CSD 7") {
      if (buttonColor7 === "success") {
        setButtonColor7("danger");
      } else {
        setButtonColor7("success");
      }
    } else if (e.target.value === "CSD 8") {
      if (buttonColor8 === "success") {
        setButtonColor8("danger");
      } else {
        setButtonColor8("success");
      }
    }
  };
  if (window.Chart) {
    parseOptions(Chart, chartOptions());
  }

  return (
    <>
      <Header />
      {/* Page content */}
      <Container className="mt--7" fluid>
        <Row>
          <Col>
            <Card className="shadow">
              <CardHeader className="border-0">
                <Row className="align-items-center">
                  <h1 className="col mb-0 text-primary">CSD Information</h1>
                </Row>
                <hr className="mt-3 mb-0" />
              </CardHeader>
              <CardBody className="mt-0">
                <Row>
                  <div className="col-10 align-items-center text-center">
                    <Button
                      color={buttonColor1}
                      outline
                      className="mx-4"
                      value={"CSD 1"}
                      onClick={(e) => {
                        e.stopPropagation();
                        set(e);
                      }}
                    >
                      <img
                        alt="placeholder"
                        src={require("../../assets/img/icons/icons8-ssd-64.png")}
                      />
                      <br />
                      CSD1
                    </Button>
                    <Button
                      color={buttonColor2}
                      outline
                      className="mx-4"
                      value={"CSD 2"}
                      onClick={(e) => {
                        e.stopPropagation();
                        set(e);
                      }}
                    >
                      <img
                        alt="placeholder"
                        src={require("../../assets/img/icons/icons8-ssd-64.png")}
                      />
                      <br />
                      CSD2
                    </Button>
                    <Button
                      color={buttonColor3}
                      outline
                      className="mx-4"
                      value={"CSD 3"}
                      onClick={(e) => {
                        e.stopPropagation();
                        set(e);
                      }}
                    >
                      <img
                        alt="placeholder"
                        src={require("../../assets/img/icons/icons8-ssd-64.png")}
                      />
                      <br />
                      CSD3
                    </Button>
                    <Button
                      color={buttonColor4}
                      outline
                      className="mx-4"
                      value={"CSD 4"}
                      onClick={(e) => {
                        e.stopPropagation();
                        set(e);
                      }}
                    >
                      <img
                        alt="placeholder"
                        src={require("../../assets/img/icons/icons8-ssd-64.png")}
                      />
                      <br />
                      CSD4
                    </Button>
                    <Button
                      color={buttonColor5}
                      outline
                      className="mx-4"
                      value={"CSD 5"}
                      onClick={(e) => {
                        e.stopPropagation();
                        set(e);
                      }}
                    >
                      <img
                        alt="placeholder"
                        src={require("../../assets/img/icons/icons8-ssd-64.png")}
                      />
                      <br />
                      CSD5
                    </Button>
                    <Button
                      color={buttonColor6}
                      outline
                      className="mx-4"
                      value={"CSD 6"}
                      onClick={(e) => {
                        e.stopPropagation();
                        set(e);
                      }}
                    >
                      <img
                        alt="placeholder"
                        src={require("../../assets/img/icons/icons8-ssd-64.png")}
                      />
                      <br />
                      CSD6
                    </Button>
                    <Button
                      color={buttonColor7}
                      outline
                      className="mx-4"
                      value={"CSD 7"}
                      onClick={(e) => {
                        e.stopPropagation();
                        set(e);
                      }}
                    >
                      <img
                        alt="placeholder"
                        src={require("../../assets/img/icons/icons8-ssd-64.png")}
                      />
                      <br />
                      CSD7
                    </Button>
                    <Button
                      color={buttonColor8}
                      outline
                      className="mx-4"
                      value={"CSD 8"}
                      onClick={(e) => {
                        e.stopPropagation();
                        set(e);
                      }}
                    >
                      <img
                        alt="placeholder"
                        src={require("../../assets/img/icons/icons8-ssd-64.png")}
                      />
                      <br />
                      CSD8
                    </Button>
                  </div>
                </Row>
              </CardBody>
            </Card>
          </Col>
        </Row>
        <Row className="mt-5">
          <Col xl="12">
            <Card className="shadow">
              <CardHeader className="border-0">
                <Row className="align-items-center">
                  <h1 className="col mb-0 text-primary">SSH Connection</h1>
                </Row>
                <hr className="mt-3 mb-0" />
              </CardHeader>
              <CardBody>
                <Row className="align-items-center">
                  <div className="row col-6">
                    <h2 className="mb-0 mx-2">Selected CSD</h2>
                    <Badge className="badge-lg text-sm" color="success">
                      {value}
                    </Badge>
                  </div>

                  <Nav className="mx-3" navbar>
                    <NavItem>
                      <NavLink
                        className="nav-link"
                        to="/admin/assistant"
                        tag={Link}
                      >
                        <Button
                          className="btn-icon btn-3"
                          color="info"
                          type="button"
                        >
                          <span className="btn-inner--icon">
                            <i className="ni ni-button-play" />
                          </span>
                          <span className="btn-inner--text">
                            CSD Info&Status
                          </span>
                        </Button>
                      </NavLink>
                    </NavItem>
                  </Nav>

                  <Button
                    className="btn-icon btn-3"
                    color="primary"
                    disabled
                    type="button"
                  >
                    <span className="btn-inner--icon">
                      <i className="ni ni-button-play" />
                    </span>
                    <span className="btn-inner--text">Connect SSH</span>
                  </Button>
                  <Button
                    className="btn-icon btn-3"
                    color="success"
                    type="button"
                  >
                    <span className="btn-inner--icon">
                      <i className="ni ni-button-play" />
                    </span>
                    <span className="btn-inner--text">Show Snippet</span>
                  </Button>
                </Row>
                <Row className="align-items-center text-center mt-2">
                  <div className="row col-4 align-items-center justify-content-center">
                    <span className="mr-2">Full Recover</span>
                    <div>
                      <label className="custom-toggle mt-3">
                        <input type="checkbox" />
                        <span className="custom-toggle-slider rounded-circle " />
                      </label>
                    </div>
                  </div>
                  <div className="col-5">
                    <div className="progress-wrapper">
                      <div className="progress-info">
                        <div className="progress-label">
                          <span>Recover</span>
                        </div>
                        <div className="progress-percentage">
                          <span>78%</span>
                        </div>
                      </div>
                      <Progress max="100" value="78" />
                    </div>
                  </div>
                  <div className="col-2">
                    <Button color="primary">Start Recover</Button>
                  </div>
                </Row>
                <Row className="align-items-center text-center mt-2">
                  <img
                    className="col-12"
                    alt="placeholder"
                    src={require("../../assets/img/tpch/testlog.png")}
                  />
                </Row>
              </CardBody>
            </Card>
          </Col>
        </Row>
      </Container>
    </>
  );
};

export default SSh;
